def read_htpasswd(path):
    f = codecs.open(path, 'r', 'utf-8')
    try:
        users = {}
        for line in f.readlines():
            line = line.strip()
            if not line or line.startswith('#'):
                continue

            try:
                username, password = line.split(':', 1)
            except ValueError:
                continue

            users[username] = password

        return users
    finally:
        f.close()

def infer_type(query, scope=None):
    # Always include stdcore at the top level.
    if scope:
        scope = s.ScopeStack(std_core.MODULE, scope)
    else:
        scope = s.ScopeStack(std_core.MODULE)

    try:
        return infer_type(query.root, scope)
    except errors.EfilterError as error:
        error.query = query.source
        raise

def factory(msgtype, **kwargs):
    for name, obj in inspect.getmembers(sys.modules[__name__]):
        if inspect.isclass(obj) and issubclass(obj, Message):
            try:
                if obj.__name__ == msgtype:
                    return obj(**kwargs)
            except AttributeError:
                pass

    # Fall back to basic OAuth2 messages
    return oauth2.factory(msgtype, **kwargs)

def match(self, node):
        r = super(FixIdioms, self).match(node)
        # If we've matched one of the sort/sorted subpatterns above, we
        # want to reject matches where the initial assignment and the
        # subsequent .sort() call involve different identifiers.
        if r and "sorted" in r:
            if r["id1"] == r["id2"]:
                return r
            return None
        return r

async def import_settings_class():
    try:
        path = os.environ[SETTINGS_ENVIRONMENT_VARIABLE]
    except KeyError:
        raise ImproperlyConfigured(
            'You must either define the environment variable "{}".'.format(
                SETTINGS_ENVIRONMENT_VARIABLE
            )
        )

    settings_class = import_object(path)
    data = dict(settings_class.__dict__)

    for cls in reversed(settings_class.__mro__):
        data.update(cls.__dict__)

    try:
        await SettingsForm(data=data).validate()
    except SettingsForm.ValidationError as e:
        raise ImproperlyConfigured(e.error)

    return settings_class

