def particle():
    a = np.random.uniform(0.0, np.pi * 2.0)
    r = np.random.uniform(0.0, 0.001)
    return np.array([0.0, 0.0, np.cos(a) * r - 0.003, np.sin(a) * r - 0.008]).astype('f4').tobytes()

def _FileContents(self, file_name):
    results = None
    if self._zip:
      try:
        results = self._zip.read(file_name)
      except KeyError:  # file not found in archve
        self._problems.MissingFile(file_name)
        return None
    else:
      try:
        data_file = open(os.path.join(self._path, file_name), 'rb')
        results = data_file.read()
      except IOError:  # file not found
        self._problems.MissingFile(file_name)
        return None

    if not results:
      self._problems.EmptyFile(file_name)
    return results

def setup_class(cls, classdict):
        # initialize struct member on
        # the class which owns them
        for k, v in classdict.items():
            if isinstance(v, BaseDescriptor):
                v.init_self(cls, k)
        # initialize the class which has
        # these struct members in its mro
        for k, v in getmembers(cls):
            if isinstance(v, BaseDescriptor):
                v.init_cls(cls)

def loads(zish_str):
    tokens = lex(zish_str)
    try:
        result = parse(next(tokens), tokens)
    except StopIteration:
        raise ZishException("No Zish value found.")
    try:
        token = next(tokens)
        raise ZishLocationException(
            token.line, token.character,
            "Multiple top-level Zish values aren't allowed. For example, at "
            "the top level you can't have a map followed by another map.")
