def call_periodically(loop: abstract_loop, interval, callback, *args):
    @asyncio.coroutine
    def wrap():
        while True:
            yield from asyncio.sleep(interval, loop=loop)
            yield from callback(*args, loop=loop)
    return ensure_future(wrap(), loop=loop)

