def parse_tone(tone):
    tone = tone.split()
    if len(tone) % 2:
        tone_label = tone.pop(0)
    else:
        tone_label = ""
    tone_points = len(tone) // 2
    if tone_points > 32:
        click.secho("You can only set up to 32 tone points!", fg="red")
        sys.exit()
    tone = tuple(float(x) for x in tone)
    return tone_label, tone_points, tone

