def consumeSemicolon():
    line = None
    if (ord(source[index]) if index < len(source) else None) == 59:
        lex()
        return
    line = lineNumber
    skipComment()
    if lineNumber != line:
        return
    if match(";"):
        lex()
        return
    if (lookahead.type != Token.EOF) and (not match("}")):
        throwUnexpected(lookahead)

