def hash(item, hash_type=1):

        if hash_type == 0:
            hash_obj = hashlib.sha3_224
        elif hash_type == 1:
            hash_obj = hashlib.sha3_256
        elif hash_type == 2:
            hash_obj = hashlib.sha3_384
        elif hash_type == 3:
            hash_obj = hashlib.sha3_512
        else:
            return None

        return hash_obj(bytes(item, 'utf-8')).hexdigest()

