def mmult(A, B):
    C = [[0.0] * len(B[0]) for _ in xrange(len(A))]
    for i in xrange(len(A)):
        for j in xrange(len(B[0])):
            C[i][j] = sum([A[i][k] * B[k][j] for k in xrange(len(B))])
    return C

