    for entry in entries:
        hyphen_free = entry.replace(separator, '').lower()
        boundary_list = [1]
        i = 1
        while i < len(entry):
            if entry[i] == separator:
                boundary_list += [1]
                i += 1
            else:
                boundary_list += [0]
            i += 1
        dict[hyphen_free] = boundary_list + [1]

