async def stop(self, force=True):
        if self._keeper is not None:
            self._keeper.cancel()
            self._event.clear()
            try:
                await self._keeper
            except asyncio.CancelledError:
                pass
            self._keeper = None
        process = self.process
        try:
            if process is None:
                pass
            elif force:
                process.kill()
            else:
                process.terminate()
        except ProcessLookupError:
            pass
        await super().stop(force=force)

