        if tag is not None:
            assert tag == poly1305(self.cipher_new, nonce, s)
        data = self.cipher_new(nonce, counter=1).encrypt(s)
        if tag is None:
            return data, poly1305(self.cipher_new, nonce, data)
        else:
            return data

async def next(cls) -> str:
        state = Dispatcher.get_current().current_state()
        state_name = await state.get_state()

        try:
            next_step = cls.states_names.index(state_name) + 1
        except ValueError:
            next_step = 0

        try:
            next_state_name = cls.states[next_step].state
        except IndexError:
            next_state_name = None

        await state.set_state(next_state_name)
        return next_state_name

