def chat(ws, channel):
    yield from ws.send("Welcome to channel <{}>".format(channel))

    asyncio.get_event_loop().create_task(redis_subscribe(ws, channel))
    conn = yield from asyncio_redis.Connection.create()

    while True:
        msg = yield from ws.receive()
        if msg is not None:
            yield from conn.publish(channel, msg.decode('utf-8'))
        else:
            break

def glGetUniform(program, location):
    n = 16
    d = float('Inf')
    params = (ctypes.c_float*n)(*[d for i in range(n)])
    res = _lib.glGetUniformfv(program, location, params)
    params = [p for p in params if p!=d]
    if len(params) == 1:
        return params[0]
    else:
        return tuple(params)

def msg_json(self, obj):
        if not self.json:
            return

        if hasattr(obj, "__json__"):
            obj = obj.__json__()

        msg = json.dumps(obj, cls=JSONEncoder,
                         indent=2)
        self.msg(u"{0}", msg)

        if isinstance(obj, dict) and obj.get("error"):
            sys.exit(1)

def config(self, part: str, setting: str, value: Any):
        if part not in self._config:
            self._config[part] = {
                "enabled": True
            }

        self._config[part][setting] = value

def run(self, context=None):
        print('Executing process %s' % self.process)
        self.process.execute()
        if self.consume_process_out:
            self._run_consumers()
        print('Process started. Waiting...')
        returncode = self.process.wait()
        print('Process ended with code %d' % returncode)
        try:
            if returncode:
                msg = self._handle_error(returncode)
            else:
                self.result = self._collect_result()
                print('[[RESULT]]: ', self.result)
        finally:
            self.process.close_streams()

def __getattr__(self, function_name):
        if self.abi is None:
            raise NoABIFound(
                "There is no ABI found for this contract.",
            )
        if '_functions' not in self.__dict__:
            raise NoABIFunctionsFound(
                "The abi for this contract contains no function definitions. ",
                "Are you sure you provided the correct contract abi?"
            )
        elif function_name not in self.__dict__['_functions']:
            raise MismatchedABI(
                "The function '{}' was not found in this contract's abi. ".format(function_name),
                "Are you sure you provided the correct contract abi?"
            )
        else:
            return super().__getattribute__(function_name)

def _aggregate_miner_data(raw_data):
    data_by_miner = groupby(0, raw_data)

    for miner, miner_data in data_by_miner.items():
        _, block_hashes, gas_prices = map(set, zip(*miner_data))
        try:
            price_percentile = percentile(gas_prices, percentile=20)
        except InsufficientData:
            price_percentile = min(gas_prices)
        yield MinerData(
            miner,
            len(set(block_hashes)),
            min(gas_prices),
            price_percentile)

def _glGetIntegerv(pname):
    n = 16
    d = -2**31  # smallest 32bit integer
    params = (ctypes.c_int*n)(*[d for i in range(n)])
    res = _lib.glGetIntegerv(pname, params)
    params = [p for p in params if p!=d]
    if len(params) == 1:
        return params[0]
    else:
        return tuple(params)

def parse_result(conf, word, _pass):
    start = int(conf.start)
    end = int(conf.start + conf.length)
    return word if _pass else word.decode('utf-8')[start:end]

