def to_jacobian(self):
        if not self:
            return JacobianPoint(x=0, y=0, z=0, curve=self.curve)
        return JacobianPoint(x=self.x, y=self.y, z=1, curve=self.curve)

def get_info(self, key, inherited=False):
        if key == '':
            return dict(self.hdf5.attrs.items())
        else:
            attrs = dict(self.hdf5[key].attrs.items())
            if inherited and hasparent(key):
                attrs.update(self.get_info('/'.join(key.split('/')[:-1]), True))
                return attrs
            else:
                return attrs

def get(cls, country):
        try:
            if PYCOUNTRY:
                c = countries.lookup(country)
                return Country(c.alpha_2, c.alpha_3, c.numeric, c.name, getattr(c, "official_name", c.name))
            else:
                c = countries.get(country)
                return Country(c.alpha2, c.alpha3, c.numeric, c.name, c.apolitical_name)
        except (LookupError, KeyError):
            raise LookupError("Invalid country code: {0}".format(country))

def delete(self, name):
        try:
            del self.config[self.section_name][name]
        except KeyError:
            return '%s: Not Found.' % name
        self.config.write()
        return '%s: Deleted' % name

def push_stack(t, s):
    if isinstance(s.current, ElseStmtNode):
        stmt = s.pop()
        s.push_stack(stmt.body)
    elif isinstance(s.current, IfStmtNode) and s.current.orelse:
        s.push_stack(s.current.orelse[-1].body)
    else:
        if not hasattr(s.current, 'body'):
            raise SyntaxError('Unexpected indent at line %d' % t[2])
        s.push_stack(s.current.body)

def clean(self, args):
        components = args.component

        component_clean_methods = {
            'all': self.clean_all,
            'dists': self.clean_dists,
            'distributions': self.clean_dists,
            'builds': self.clean_builds,
            'bootstrap_builds': self.clean_bootstrap_builds,
            'downloads': self.clean_download_cache}

        for component in components:
            if component not in component_clean_methods:
                raise BuildInterruptingException((
                    'Asked to clean "{}" but this argument is not '
                    'recognised'.format(component)))
            component_clean_methods[component](args)

def print_record(record):
    if verbose == 0: 
        return

    if verbose > 1:
        pprint(record) # Very chatty
        return

    # Otherwise print a nice summary of the record
    if 'delete_status_id' in record:
        print("delete %d %d" % (
            record['delete_status_id'],
            record['delete_status_user_id']))
    else:
        print("status %s %d %d" % (
            record['created_at'], 
            record['id'], 
            record['user_id']))

def PortConnection(cls, pc, ctx):
        if pc.portItem._dtype != pc.sig._dtype:
            raise SerializerException(
                "Port map %s is nod valid (types does not match)  (%s, %s)" % (
                    "%s => %s" % (pc.portItem.name, cls.asHdl(pc.sig, ctx)),
                    repr(pc.portItem._dtype), repr(pc.sig._dtype)))
        return ".%s(%s)" % (pc.portItem.name, cls.asHdl(pc.sig, ctx))

def find_previous_service_containers(self, service):
        previous_containers = {}
        results = self.find_service_containers(service)

        if results:
            for container in six.itervalues(results):
                if container.name not in service.containers:
                    previous_containers[container.name] = container
                    continue

        return previous_containers

